import React from 'react';
import styles from './Analyze.module.scss'

export const Analyze = () => {
    return (
        <div className='wrapper'>
            <div className='content'>
                <div className={styles.root}>
                    <h1>
                        <span>
                            Analyze it!
                        </span>
                    </h1>
                </div>
            </div>
        </div>
    )
}

export default Analyze;
